- proto: Paper
  entities:
  - uid: 336
    components:
    - type: Transform
      pos: 2.0169,-0.007956028
      parent: 289
    - type: Paper
      content: >-
        Source of power generally output into HV power cables, which are rarely connected to power consumers. There are, however, some exceptions:


         • Field generators, particularly PACMANs and their variants, can be modified to connect to MV power cables. This is useful for establishing emergency power in a localized area.


         • The Power Monitoring Console requires a direct connection to the power grid via an HV power cable in order to scan the network completely.
  - uid: 337
    components:
    - type: Transform
      pos: 5.17315,0.08579397
      parent: 289
    - type: Paper
      content: >-
        An SMES is essentially a big battery. It consumes power and stores it for later. They are not very effective as capacitors as a result of their slow ramp-up time, meaning that sudden changes in power consumption or power supply are likely to cause a brown-out. More SMESes means more resilience against such.


        The amount of power that a single SMES can hold is generally <2 minutes, although this can vary wildly depending on the power consumption of the network.
  - uid: 338
    components:
    - type: Transform
      pos: 8.23565,0.10141897
      parent: 289
    - type: Paper
      content: Substations are transformers that also have an amount of battery charge. They convert HV to MV, and can store about a minute of power on their own. They are usually used to connect to several rooms associated with a specific department or sector on the station.
  - uid: 339
    components:
    - type: Transform
      pos: 11.001275,0.10141897
      parent: 289
    - type: Paper
      content: APCs are generally placed in each room, or group of closely-related rooms. They have about a minute's worth of power storage within them, and they also act as a transformer from MV to LV.
  - uid: 340
    components:
    - type: Transform
      pos: 11.021705,-8.941886
      parent: 289
    - type: Paper
      content: >-
        Note that lights placed facing into any of the frosted tiles will be powered. It is generally wise to cover the wall as well, to power embedded objects such as airlocks.


        Overlap between different APC networks is allowed but behaves in unpredictable ways in-game, and should be avoided where possible. Favor the APC with the most restricted, most interior access; if there is an "inside" and an "outside", the "inside" APC should own the wall.
  - uid: 341
    components:
    - type: Transform
      pos: 1.960597,-2.9512033
      parent: 289
    - type: Paper
      content: HV power cables generally connect the primary power sources to the SMES bank, and the SMES bank to all of the substations around the map. Placing grilles over these creates a deadly electrical fence that should be covered by a reinforced window and marked as an electrical hazard.
  - uid: 342
    components:
    - type: Transform
      pos: 4.991847,-5.0137033
      parent: 289
    - type: Paper
      content: Cable Terminals isolate two wire networks from one another, and are used by SMESes to designate their [italic]source[/italic] cable. The cable placed beneath the SMES is the [italic]output[/italic] cable.
  - uid: 343
    components:
    - type: Transform
      pos: 7.976222,-3.0293283
      parent: 289
    - type: Paper
      content: MV power cables are sometimes used to connect specific machines to the grid, but generally go directly to the APCs near a substation. They deliver a less lethal shock than HV power cables when placed beneath a grille, but should still be clearly marked in well-lit and high-traffic areas.
  - uid: 344
    components:
    - type: Transform
      pos: 14.00608,-2.9512033
      parent: 289
    - type: Paper
      content: LV power cables deliver energy to most power consumers within a 5x5 square centered on its position, and grilles placed above them will deliver a minor shock that can safely be used as a deterrent in low-traffic areas, provided they are clearly marked and well-lit.
  - uid: 345
    components:
    - type: Transform
      pos: 16.021706,0.048796654
      parent: 289
    - type: Paper
      content: Power consumers usually require LV power cables to be placed within 2 tiles square-radius of their position. There are some exceptions, but they are few.
  - uid: 386
    components:
    - type: Transform
      pos: 2.8847075,-9.942953
      parent: 289
    - type: Paper
      content: It is generally best not to place the APC in such a position where its LV power cable would power some other room's contents. Instead, consider placing APCs in a location central to the area which they provide power to, ideally on a wall between two rooms it powers.
  - uid: 387
    components:
    - type: Transform
      pos: 8.007167,-10.646078
      parent: 289
    - type: Paper
      content: >-
        If you must run a power cable underneath a solid object, prefer the following order:


         • Airlocks are generally a safe bet, and you should not feel bad running wires under them.


         • Windows in a pinch, if you really cannot find some other airlock to place the wire under.


         • Solid walls only when the alternative is running the wire clear across the other side of the station. Consider adding another maintenance door to avoid running wire under solid walls.
  - uid: 389
    components:
    - type: Transform
      pos: 24.93444,0.013594151
      parent: 388
    - type: Paper
      content: Pipes balance gasses across their whole network, mixing temperature and chemical contents over time. This process is gradual, and is rather slow due to diffusion.
  - uid: 398
    components:
    - type: Transform
      pos: 31.080997,0.026853323
      parent: 388
    - type: Paper
      content: >-
        Breathable air consists of primarily Oxygen and Nitrogen reagents. Most races require at [italic]least[/italic] Oxygen. Slimes require Nitrogen instead.


        The atmosphere is [italic]mostly[/italic] Nitrogen. The ideal ratio is 22% Oxygen, 78% Nitrogen, give or take 2.5%.
  - uid: 407
    components:
    - type: Transform
      pos: 30.090828,-1.519222
      parent: 388
    - type: Paper
      content: >-
        The ideal pressure for breathable atmosphere is 101.325 kPa, with a safety range of 90 kPa to 300 kPa.


        The Mixer takes a Primary Input (which moves straight through) and a Secondary Input (which comes in at a right angle). When setting these up, ensure you double-check which port is which.
  - uid: 408
    components:
    - type: Transform
      pos: 31.028328,-2.9879723
      parent: 388
    - type: Paper
      content: >-
        Comfortable room temperature is 20°C, but characters can tolerate freezing conditions with a warm coat or hardsuit. Lizards are cold-blooded, and require at least 15°C in order to remain healthy.


        Temperatures above 60°C are unsafe for all crew, especially Moths.
  - uid: 415
    components:
    - type: Transform
      pos: 33.070736,-1.8458214
      parent: 388
    - type: Paper
      content: Air vents pump the contents of connected pipes into the room when the external pressure is below target. This is usually the source of breathable air. You will want one of these in every sealed room (even if it has a door) to ensure people do not suffocate when the room runs out of air.
  - uid: 416
    components:
    - type: Transform
      pos: 34.945736,-1.9083214
      parent: 388
    - type: Paper
      content: Air scrubbers selectively remove certain reagents from the external air and push them into connected pipes. You will want one of these in every single sealed room (even if it has a door) to ensure that people do not suffocate in their own CO2 emission.
  - uid: 423
    components:
    - type: Transform
      pos: 22.989937,-3.5333214
      parent: 388
    - type: Paper
      content: Gas Miners are a free infinite source of a specific gas. They can be configured to produce more or less pressure, and should be contained inside of a sealed room for safety.
  - uid: 429
    components:
    - type: Transform
      pos: 33.049088,-3.063147
      parent: 388
    - type: Paper
      content: Injectors push contents out of the pipes and into the room as hard as they can. They are not powerful enough to fill a room higher than 9,000 kPa, and so the pipes will at that point back up.
  - uid: 430
    components:
    - type: Transform
      pos: 34.986588,-3.047522
      parent: 388
    - type: Paper
      content: Passive Vents allow the pipes and the external air to be directly connected, meaning that each will freely diffuse into the other until they reach equillibrium. This is the most effective way to siphon gas from a room containing Gas Miner.
  - uid: 449
    components:
    - type: Transform
      pos: 24.483875,-6.1555376
      parent: 388
    - type: Paper
      content: The Gas Pump acts as a barrier between two pipe networks. It can be shut off entirely, preventing any transfer of gas, or it can be set to pump one end into the other until reaching a maximum pressure. They cannot be reversed to pump the other direction.
  - uid: 450
    components:
    - type: Transform
      pos: 24.4995,-7.1711626
      parent: 388
    - type: Paper
      content: >-
        Volumetric Pumps function the same as Gas Pumps, except they are limited by [italic]rate[/italic] instead of by [italic]pressure[/italic]. This means that you can ensure a fixed amount of gas is moved per unit of time, without concerning yourself about whether the other end is full or not.


        Take note that, like other kinds of pump, the Volumetric Pump cannot push harder than 9,000 kPa. If the output end is above that pressure, the input end will back up.
  - uid: 451
    components:
    - type: Transform
      pos: 24.53075,-8.124288
      parent: 388
    - type: Paper
      content: The Passive Gate is a one-way gate that ensures air does not backwash from one end into the other. Take note of the red circle on the sprite. This identifies the input end, which will provide gas to the flat side. As long as the pressure on the left is higher than the pressure on the right, this Passive Gate will continue to work, regardless of what those pressure values actually are.
  - uid: 452
    components:
    - type: Transform
      pos: 24.483875,-9.030538
      parent: 388
    - type: Paper
      content: The Manual Valve acts as a door between two pipe networks, and is easily opened and closed by hand in-character. When the light is green, the valve is open, allowing gas to pass freely in either direction. When it is red, the pipe networks are completely separated from each other, preventing their contents from mixing.
  - uid: 456
    components:
    - type: Transform
      pos: 27.96748,-8.516995
      parent: 388
    - type: Paper
      content: "The radiator slowly equalizes the [italic]temperature[/italic] of the interior and exterior atmospheres. If the radiator is placed in a vacuum, it will cool the contents within the pipe network.\n\nRadiators require [italic]flow[/italic] in order to function; simply filling them with air is insufficient. This usually requires a pump somewhere on the output network to ensure that gas continues to move through the radiator. "
  - uid: 464
    components:
    - type: Transform
      pos: 30.477798,-6.9701204
      parent: 388
    - type: Paper
      content: This radiator loop will eventually even out the temperature of the gasses inside the pipes with the temperature of the air oustide the pipes. Since it has been placed in a vacuum, the contents will approach 0°K, Zeno's Paradox-style.
  - uid: 469
    components:
    - type: Transform
      pos: 32.99814,-7.042612
      parent: 388
    - type: Paper
      content: Plasma is a very effective temperature-storing gas because it requires a great deal of energy to change its temperature. This means that machines such as the TEG, which depend upon a temperature differential to produce power, will be more stable if the gas temperature medium is Plasma.
  - uid: 470
    components:
    - type: Transform
      pos: 34.982513,-7.026987
      parent: 388
    - type: Paper
      content: Nitrogen is an inert gas that changes temperature rather easily, but is quite safe to use. It is unlikely to start a fire, and it is not toxic if it is leaked into the room. It is the [italic]safe[/italic] choice for machines such as the TEG.
  - uid: 535
    components:
    - type: Transform
      pos: 38.00742,-7.9801035
      parent: 388
    - type: Paper
      content: >-
        To create a plasma fire, you require three ingredients:


         • Plasma (2%)

         • Oxygen (98%)

         • Heat (>50°C)


        A spark is not actually needed. The mix will ignite on its own when it reaches the appropriate temperature. However, a spark is a very effective way to get it to reach that temperature!
  - uid: 536
    components:
    - type: Transform
      pos: 38.054295,-11.9957285
      parent: 388
    - type: Paper
      content: This reaction chamber is set up to contain a plasma fire, which will provide a source of extreme heat for the radiators, which will cause the plasma inside the pipes to become hot as well.
  - uid: 537
    components:
    - type: Transform
      pos: 29.00742,-11.9644785
      parent: 388
    - type: Paper
      content: These radiators are exposed to space, and so will cool the Plasma inside the connected pipes.
  - uid: 538
    components:
    - type: Transform
      pos: 33.554295,-10.6832285
      parent: 388
    - type: Paper
      content: >-
        The TEG, like Radiators, requires [italic]flow[/italic] in order to function, and additionally requires that the temperature of one side be different from the temperature of the opposite. It does not actually matter which side is hot and which side is cold. The direction of airflow, however, [italic]does[/italic] matter. Shift-click the Circulators on either side of the TEG to see which direction they are set up in.


        The gasses on either side remain unmixed, but their temperature will be gradually equalized, so both ends must have a continuous source of heating and cooling.
  - uid: 539
    components:
    - type: Transform
      pos: 34.846268,-12.894567
      parent: 388
    - type: Paper
